import React from 'react'

class Admin extends React.Component {
    state = {
        cmd: ''
    }
    render() {
        return (
            <div>
                <input type="text" value={this.state.cmd} required onChange={(e) => this.setState({cmd: e.target.value})} />
            </div>
        )
    }
}

export default Admin
